import React from 'react'
import ActivityCard from './ActivityCard'

function ActivityL({activity, search,}) {
  return (
    <div className='list'>
{activity.filter((mv)=>mv.activityName.toLowerCase().includes(search.toLowerCase())).map((el)=><Activitycard el={el}/>)}
    </div>
  )
}

export default ActivityL
